import { Component } from "react";

class Pavani extends Component{
    constructor(props){
        super(props);
        this.state={
           id:1,
           book:"react js",
           author:"rgahva"
        }
        
    }
    change=()=>{
        this.setState({
            id:2,
            author:"pavani",
            book:"java"
        })
    }
    render(){
        return(
        <div>
            <p>
                id:{this.state.id}<br/>
                book:{this.state.book}<br/>
                author:{this.state.author}
            </p>
            <button onClick={this.change}>update</button>

        </div>)
    }
}
export default Pavani
